import React from 'react';
import ReactDom from 'react-dom';
import Tile from './Tile'

const ChemData = require('periodic-table');
var chemArray = [];
var atomicNum = 1;
function addArray(){
    for(let x in ChemData.numbers){
        // if((x > 1 && x < 18) || (x>20 && x < 31)|| (x>38 && x < 49)){
        //     chemArray[x-1] = []; 
        // }else{
        //     chemArray[x-1] = ChemData.numbers[atomicNum];  
        //     atomicNum++;
        // }
        chemArray[x-1] = ChemData.numbers[x];
    }
}

console.log(chemArray)

function addTile(data)
{
    return <Tile 
        name = {data.symbol}
    />
}

function TableHolder(){
    return <div className='PTable'>
        {addArray(), chemArray.map(addTile)}
        
    </div>
}

export default TableHolder;
